<template>
	<view class="main-content" :style="{'background-image':'url('+bgColor1+')'}">
		<!-- <view v-if="hasLogin" class="hello"></view>
        <view v-if="!hasLogin" class="hello"></view> -->
		<view id="header" class="header">
			<view class="header-border">
				<image src="../../static/img/main/pan.png" class="header-icon" />
				<text>889088</text>
			</view>
			<view class="header-border">
				<image src="../../static/img/main/focus.svg" class="header-icon" />
				<text>657</text>
			</view>
		</view>
		<view class="header-border" style="border:0.1upx solid #8F8F94;">
			<image src="../../static/img/main/notice.png" class="header-icon" />
			<text>公益基金池建設中，首次捐贈10個token星球返回10個</text>
		</view>
		<view class="token-area" :style="{'background-image':'url('+bgColor+')'}">
			<!-- <view class="welfare-content" @tap="toPan">
				<image src="../../static/img/main/welfare.png" class="welfare-icon" />
				<view class="welfare-text">星球公益</view>
			</view> -->
			<view class="planetPublic">
				<view class="planetPublic-box">
					<image src="../../static/img/main/welfare.png" class="welfare-icon" />
					<view class="planet-text">星球公益</view>
				</view>
			</view>
			<view id="content" class="token-content">
				<!-- <token v-for="(item, index) in tokens" :key="index" class="mine-item topTobottom" :tokenValue="item" :index="index"
				 @confirm="pushToken" /> -->
				<view id="token" class="token topTobottom" v-for="(item, index) in tokenList" :style="{'left':item.leftVal+'px','top':item.topVal+'px','display':item.display}"
				 :key="index" v-bind:class="{'topTobottom-1':Math.random()>0.4,'topTobottom':Math.random()<0.4}" @click="pushToken(item,index,$event)">
					<image src="../../static/img/main/token.png" class="token-icon"></image>
					<view class="token-num">{{item.value}}</view>
				</view>
			</view>
		</view>
		<!-- swiper滑动器 -->
		<swiper class="swiper" :indicator-dots="indicatorDots" :autoplay="autoplay" :interval="interval" :duration="duration"
		 :circular="circular" next-margin="1upx" display-multiple-items=2.2>
			<swiper-item v-for="(i, ind) in slides" :key="ind">
				<navigator class="swiper-item" :url="i.linkTab">
					<img :src="i.number" alt="加载失败">
				</navigator>
			</swiper-item>
		</swiper>
	</view>
</template>

<script>
	//import token from '../../components/token.vue';
	import {
		mainSlider
	} from '../../common/js/json.js';
	import {
		mapState
	} from 'vuex';

	export default {
		data() {
			return {
				slides: '',
				indicatorDots: false,
				autoplay: false,
				interval: 2000,
				duration: 500,
				circular: false,
				currentSwiper: 0,
				tokens: [],
				tokenList: [],
				bgColor: "",
				bgColor1: "",
				bgImage1: "data:image/svg+xml;base64,",
				bgImage2: "data:image/gif;base64,",
				targetWidth: "",
				tokenWidth: "",
				initToken: 0
			}
		},
		methods: {
			toPan() {
				uni.switchTab({
					url: '../pan/pan'
				});
			},
			getMainSlider() {
				mainSlider().then(data => {
					this.slides = data;
				});
			},
			async getToken() { //获取token
				let res = await this.api.homeToken().getIndexPan();
				if (res.data.status == 200) {
					this.tokens = [0.12, 0.23, 0.44, 0.33];
					if (this.tokens.length == 0) {
						this.bgColor = "";
						this.bgColor1 = this.bgImage2;
					} else {
						this.bgColor = this.bgImage1;
						this.bgColor1 = "";
					}
					let num = this.tokens.length;
					let iconWidth;
					let iconHeight;
					uni.createSelectorQuery().select(".planetPublic-box").fields({
						size: true,
					}, (data) => {
						iconWidth = data.width;
						this.tokenWidth = iconWidth;
						iconHeight = data.height;
					}).exec();
					uni.createSelectorQuery().select("#content").fields({
						size: true,
					}, (data) => {
						//planetPublic-box
						let targetHeight = data.height;
						let targetWidth = data.width;
						this.targetWidth = targetWidth;
						let _tmpArray = [];
						let html = "";
						//当放置的元素的宽高大于容器的宽高时，直接返回
						if (targetWidth < iconWidth || targetHeight < iconHeight) {
							return false;
						}
						let xNum = parseInt(targetWidth / iconWidth, 10); //用浏览器的宽度除以一个元素的宽度可算出浏览器窗口内一行可以放置元素的个数
						let yNum = parseInt(targetHeight / iconHeight, 10); //用浏览器的高度除以一个元素的高度可算出浏览器窗口内一列可以放置元素的个数
						let allNum = xNum * yNum; //浏览器窗口内总共可以放置元素的个数
						//当需要放置的元素的个数超过浏览器窗口内总共可以放置的元素的个数时，则返回
						if (num >= allNum) {
							return false;
						}
						for (let i = 0; i < allNum; i++) {
							_tmpArray.push(i);
						}
						let xStart = 0,
							yStart = 0;
						let arr = [];
						while (num) {
							var pointer = Math.floor(Math.random() * allNum); //向下取整取出0到allnum之间的任意一个整数
							//如果数组_tmpArray中不存在第pointer值，则继续
							if (!_tmpArray[pointer]) {
								continue;
							}

							delete _tmpArray[pointer]; //删除数组_tmpArray中第pointer个值
							yStart = parseInt(pointer / xNum, 10) * iconWidth;
							xStart = (pointer % xNum) * iconHeight;
							let o = {
								value: this.tokens[num - 1],
								leftVal: xStart,
								topVal: yStart,
								display: "block",
								styleVal: {
									'left': xStart + 'px',
									'top': yStart + 'px'
								}
							}
							arr.push(o);
							num--;
						}
						this.tokenList = arr;
					}).exec();
				}
			},
			pushToken(item, index, e) { //收取token
				this.initToken += 1;
				this.tokenList[index].leftVal = 30;
				this.tokenList[index].topVal = -this.tokenWidth - 60;
				setTimeout(() => {
					this.tokenList[index].display = 'none';
					this.takePan(item.value);
					if (this.initToken >= this.tokens.length) {
						this.bgColor = "";
						this.bgColor1 = this.bgImage2;
					}
				}, 1500);
			},
			async takePan(token) {
				let res = await this.api.homeToken().takePan({
					numbers: Number(token)
				});
				if (res.data.status == 200) {
					console.log("成功");
				}
			}
		},
		onLoad() {
			this.getMainSlider();
			this.getToken();
		}
	}
</script>

<style lang="scss" scoped="true">
	.header {
		display: flex;
		flex-direction: row;
		margin-left: 0;

	}

	.main-content {
		width: 100%;
		min-height: 100%;
		background-size: 100%;
		background-position: center;
		background-repeat: no-repeat;
	}

	.header-border {
		border: 1px solid #C8C7CC;
		border-radius: 30upx;
		display: flex;
		flex-direction: row;
		padding: 5upx 20upx;
		margin: 0 20upx 10upx 0;
	}

	.header-icon {
		display: flex;
		flex-direction: row;
		width: 32upx;
		height: 32upx;
	}

	text {
		font-size: 25upx;
		margin-left: 15upx;
		margin-bottom: 5upx;
	}

	.token-area {
		width: 100%;
		height: 600upx;
		position: relative;
		// overflow: hidden;
		background-repeat: no-repeat;
		background-position: center;

		.planetPublic {
			width: 100%;
			height: 100upx;
			display: flex;
			justify-content: flex-end;
			align-items: center;
		}

		.planetPublic-box {
			width: 128upx;
			height: 128upx;
			display: flex;
			flex-direction: column;
			align-items: center;
			justify-content: center;

			.welfare-icon {
				width: 45upx;
				height: 40upx;
			}

			.planet-text {
				font-size: 22upx;
				color: #4CD964;
			}
		}
	}

	.token-content {
		width: 100%;
		height: 500upx;
		position: relative;

		.token {
			position: absolute;
			width: 128upx;
			height: 110upx;
			text-align: center;
			z-index: 66;
			transition-property: all;
			transition-duration: 1.5s;
			transition-timing-function: ease-out;

			.token-icon {
				width: 48upx;
				height: 48upx;
			}

			.token-num {
				font-size: 25upx;
			}
		}
	}

	.welfare-content {
		position: absolute;
		top: 25upx;
		right: 30upx;
		margin-top: 20upx;
		z-index: 6;
		width: 120upx;
		// height: 88upx;
		text-align: center;

		.welfare-icon {
			margin: 0 auto;
			display: block;
		}

		.welfare-text {
			text-align: center;
		}
	}

	.welfare-icon {
		width: 55upx;
		height: 48upx;
		margin-bottom: 8upx;
	}

	.welfare-text {
		margin-left: -22upx;
		font-size: 25upx;
		color: #4CD964;
	}

	.swiper {
		position: absolute;
		bottom: 40upx;
		width: 100%;
		height: 450upx;
	}

	.swiper-item>img {
		width: 300upx;
	}

	/* 动画 */
	.topTobottom {
		animation-name: topTobottom;
		animation-duration: 3s;
		animation-timing-function: linear;
		animation-iteration-count: infinite;
	}

	.topTobottom-1 {
		animation-name: topTobottom;
		animation-duration: 3s;
		animation-timing-function: linear;
		animation-delay: 1s;
		animation-iteration-count: infinite;
	}

	@keyframes topTobottom {
		0% {
			transform: translate(0, 0)
		}

		50% {
			transform: translate(0, 6px)
		}

		100% {
			transform: translate(0, 0)
		}
	}

	@-moz-keyframes topTobottom

	/* Firefox */
		{
		0% {
			transform: translate(0, 0)
		}

		50% {
			transform: translate(0, 6px)
		}

		100% {
			transform: translate(0, 0)
		}
	}

	@-webkit-keyframes topTobottom

	/* Safari 和 Chrome */
		{
		0% {
			transform: translate(0, 0)
		}

		50% {
			transform: translate(0, 6px)
		}

		100% {
			transform: translate(0, 0)
		}
	}

	@-o-keyframes topTobottom

	/* Opera */
		{
		0% {
			transform: translate(0, 0)
		}

		50% {
			transform: translate(0, 6px)
		}

		100% {
			transform: translate(0, 0)
		}
	}
</style>
